import React, { useEffect, useState } from 'react'

const NotesPage = () => {
  let [notes, setNotes] = useState([])

  useEffect(() => {
    getNotes()
  }, [])

  let getNotes = async () => {
    let response = await fetch('/api/notes/3/')
    let data = await response.json()
    setNotes(data)
  }

  return (
    <div>
      <div>
        <h3>{notes.body}</h3>
      </div>
    </div>
  )
}

export default NotesPage
